from handlers import rem_vuln
import json
import os

import clean_filename
import PySimpleGUI as sg


class app:
    def __init__(self):
        self.app = {}
        self.attachments = {}
        self.vulns = {}
        self.windows = {}
        self.attachment_types = []
        self.choices = []
        self.saved = True

        self.app_name = ""
        self.app_id = ""
        self.app_url = ""
        self.app_env = ""

        # Projects folder where project .json files are saved
        self.projects_folder = os.path.join(os.getcwd(), "projects")

        # Templates folder where template .json files are saved to and loaded from
        self.templates_folder = os.path.join(os.getcwd(), "templates")

        # Attachments folder where attachment .json files are saved and loaded from
        self.attachments_folder = os.path.join(os.getcwd(), "attachments")

        self.set_attachment_types()
        self.set_choices()

    def main(self):
        return self.windows["main"] if "main" in self.windows else False

    def get_win_prop(self, prop):
        return self.windows["main"][prop]

    def set_win_prop(self, window, prop, value):
        self.windows[window][prop].update(value=value)

    def set_win_prop_list(self, window, prop, value):
        self.windows[window][prop].update(value)

    def set_app(self, values):
        self.app = values

    @property
    def saved(self):
        """
        The current project's saved state
        :param value:    saved state True or False
        :type data:     (boolean)
        :return:        the current project's saved state
        :rtype:         (boolean)
        """
        return self._saved

    @saved.setter
    def saved(self, value):
        self._saved = value
        if self.main():
            if self._saved:
                self.main().TKroot.title("Squiddy")
            if not self._saved:
                self.main().TKroot.title("Squiddy *")

    @saved.deleter
    def saved(self):
        del self._saved

    def set_choices(self):
        if not os.path.exists(self.templates_folder):
            self.choices = []
        self.choices = sorted(
            [elem.replace(".json", "") for elem in os.listdir(self.templates_folder)]
        )

    def get_choices(self):
        return self.choices

    # Set list of vulns
    def set_vulns(self, values):
        self.vulns = values

    # Get vuln by id
    def get_vuln(self, id):
        if not id in self.vulns:
            return {}
        return self.vulns[id]

    # Set vuln by id
    def set_vuln(self, id, values):
        self.rem_vuln(id)
        id = values["scanid"]
        self.vulns[id] = values

    # Sorted vuln list on main ui
    def vuln_list(self):
        return [
            self.vulns[vuln]["scanid"] + " - " + self.vulns[vuln]["title"]
            for vuln in sorted(self.vulns)
        ]

    # Number of vulns
    def vuln_count(self):
        return len(self.vulns)

    # Remove vuln from list
    def rem_vuln(self, id):
        self.vulns.pop(id, None)

    # Save project
    def save(self):
        appname = clean_filename.clean(self.app["appname"])
        appid = clean_filename.clean(self.app["appid"])

        filename = appname + "-" + appid + ".json"

        with open(os.path.join(self.projects_folder, filename), "w+") as fp:
            self.app.pop("existing_project", None)
            self.app.pop("vuln_list", None)
            content = {
                "app": self.app,
                "vulns": self.vulns,
                "attachments": self.attachments,
            }
            json.dump(content, fp)

        self.saved = True
        sg.popup("Saved Project: ", self.app["appname"])

    def save_template(self, window, values):
        cwe = clean_filename.clean(values["cwe"])
        title = clean_filename.clean(values["title"])

        filename = cwe + " - " + title + ".json"
        template_file = os.path.join(self.templates_folder, filename)

        if os.path.exists(template_file):
            confirm = sg.popup(
                "Template already exists. Would you like to overwrite it?\n\nIf not, please change the title to make it unique.",
                title="Overwrite Template?",
                keep_on_top=True,
                button_type=1,
            )
            # None is happens when the "X" is clicked rather than yes or no
            if confirm is None or confirm not in ("Yes"):
                return

        values["links"] = (
            window["info"].metadata["links"]
            if "links" in window["info"].metadata
            else []
        )

        with open(template_file, "w+") as fp:
            values.pop("vuln_name", None)
            values.pop("scan_id", None)
            values.pop("-BOX-CWE", None)
            values.pop("-BOX-TITLE", None)
            values.pop("status", None)
            values.pop("scanid", None)

            json.dump(values, fp)

    def set_attachment_types(self):
        self.attachment_types = [
            elem.replace(".json", "") for elem in os.listdir(self.attachments_folder)
        ]

    def get_attachment_types(self):
        return self.attachment_types

    def attachment_list(self):
        return [attachment for attachment in sorted(self.attachments)]

    def set_attachments(self, values):
        self.attachments = values

    def get_attachment(self, id):
        if id in self.attachments:
            return self.attachments[id]
        return {}

    def rem_attachment(self, id):
        self.attachments.pop(id, None)

    def new_project(self):
        main = self.windows["main"]
        self.__init__()
        self.windows["main"] = main

    # App Name
    @property
    def app_name(self):
        """
        The current application name being tested
        :param data:    data from the event loop
        :type data:     (array)
        :return:        the current application name
        :rtype:         (str)
        """
        return self._app_name

    @app_name.setter
    def app_name(self, data):
        value = self.get_prop_value(data, "appname")
        self._app_name = value

    @app_name.deleter
    def app_name(self):
        del self._app_name

    # App ID
    @property
    def app_id(self):
        """
        The current application id being tested
        :param data:    data from the event loop
        :type data:     (array)
        :return:        the current application id
        :rtype:         (str)
        """
        return self._app_id

    @app_id.setter
    def app_id(self, data):
        value = self.get_prop_value(data, "appid")
        self._app_id = value

    @app_id.deleter
    def app_id(self):
        del self._app_id

    # App URL
    @property
    def app_url(self):
        """
        The current application url being tested
        :param data:    data from the event loop
        :type data:     (array)
        :return:        the current application url
        :rtype:         (str)
        """
        return self._app_url

    @app_url.setter
    def app_url(self, data):
        value = self.get_prop_value(data, "appurl")
        self._app_url = value

    @app_url.deleter
    def app_url(self):
        del self._app_url

    # App Env
    @property
    def app_env(self):
        """
        The current application environment being tested
        :param data:    data from the event loop
        :type data:     (array)
        :return:        the current application environment
        :rtype:         (str)
        """
        return self._app_env

    @app_env.setter
    def app_env(self, data):
        value = self.get_prop_value(data, "appenv")
        self._app_env = value

    @app_env.deleter
    def app_env(self):
        del self._app_env

    # App Props
    def set_app_prop(self, prop, value):
        self.app[prop] = value

    def get_app_prop(self, prop):
        if prop in self.app:
            return self.app[prop]
        return ""

    def get_prop_value(self, data, prop):
        return (
            data["app"][prop] if data and "app" in data and prop in data["app"] else ""
        )

    # Window Icon
    def icon(self):
        return b""
